import React from 'react';
import ReactDom from 'react-dom';

function Contributors() {
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Contributors
                </p>
            </header>
        </div>
    );
}
let dog = 5;
ReactDOM.render(
    dog,
    document.getElementById('root')
  );
export default Contributors;
